import fetch from 'isomorphic-unfetch'; // For fetch API
import Head from 'next/head';
import { Component } from 'react';
import Router from 'next/router';
import Link from 'next/link';
import Layout from '../components/MyLayout';
// import Kickstarterpath from './kickstarterpath';
import AdminProfile from './adminprofile';

export default class Login extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			username    : '',
			password    : '',
			users       : [],
			currentUser : '',
			message     : '',
			redirect    : false
		};
	}

	static async getInitialProps() {
		const res = await fetch('http://localhost:3000/users');
		const data = await res.json();
		console.log(`User data fetched. Count: ${data.length}`);

		return {
			// poses : data.map((entry) => entry.pose)
			users : data
		};
	}

	handleChange = (e) => {
		this.setState({ [e.target.id]: e.target.value });
	};

	handleSubmit = (event) => {
		event.preventDefault();
		console.log(this.state.users);
		if (this.state.username === 'takerbiker') {
			Router.push('/Kickstarterpath');
			// <Kickstarterpath username={this.state.username} />;
		} else if (this.state.username === 'admin') {
			Router.push('/AdminProfile');
			// <AdminProfile username={this.state.username} />;
		}
	};

	render() {
		// if (this.state.redirect === true) {
		// 	return <Redirect to="/kickstarter" />;
		// }
		// console.log(this.state.user, this.state.password);
		const { users } = this.props;
		return (
			<Layout title="Log in Page">
				<Head>
					<title>Review your class</title>
					<link
						rel="stylesheet"
						href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
					/>
				</Head>
				{console.log(users)}
				<div className="jumbo1">
					<div className="bodyCenter card card-space">
						{/* FORM  */}

						<form onSubmit={this.handleSubmit} className="form-signin">
							<img
								className="mb-4"
								src="data:image/png;base64,"
								alt=""
								width="120"
								height="120"
							/>
							<h1 className="h3 mb-3 font-weight-normal">Please sign in</h1>
							<label htmlFor="username" className="sr-only">
								Username
							</label>
							<input
								type="username"
								id="username"
								name="username"
								className="form-control"
								placeholder="Username"
								required=""
								autoFocus=""
								value={this.state.username}
								onChange={this.handleChange}
							/>
							<label htmlFor="password" className="sr-only">
								Password
							</label>
							<input
								type="password"
								id="password"
								name="name"
								className="form-control"
								placeholder="Password"
								required=""
								value={this.state.password}
								onChange={this.handleChange}
							/>

							<button className="btn btn-lg btn-primary btn-block" type="submit">
								Sign in
							</button>
						</form>
					</div>
				</div>
				<style jsx>{`
					.bodyCenter {
						width: 400px;
						display: block;
						margin: 0 auto;
						text-align: center;
						box-shadow: 9px 7px 20px -10px rgba(0, 0, 0, 0.75);
					}

					.card-space {
						margin-top: 4%;
						padding: 3%;
					}
					.jumbo1 {
						background: linear-gradient(rgba(0, 0, 0, 0.2), rgba(0, 0, 0, 0.1)),
							url('https://images.unsplash.com/photo-1533628635777-112b2239b1c7?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1650&q=80');
						background-size: contain;
						// background-position: 10% 30%;
						/* opacity: 80%; */
						// min-height: 300px;
						// padding-top: 20%;
						padding-bottom: 20%;
					}
				`}</style>
			</Layout>
		);
	}
}
